import React from 'react';

const history = [
  { date:'Aug 2024', risk:'HIGH',   tests:4, ab:4 },
  { date:'Sep 2024', risk:'HIGH',   tests:4, ab:3 },
  { date:'Oct 2024', risk:'MEDIUM', tests:5, ab:2 },
  { date:'Nov 2024', risk:'MEDIUM', tests:5, ab:2 },
  { date:'Dec 2024', risk:'MEDIUM', tests:6, ab:1 },
  { date:'Jan 2025', risk:'LOW',    tests:6, ab:0 },
];
const trends = [
  { name:'Blood Sugar (FBS)', vals:[145,138,128,122,115,108], unit:'mg/dL', normal:100, color:'#f59e0b' },
  { name:'Cholesterol',       vals:[225,218,210,205,200,192], unit:'mg/dL', normal:200, color:'#fb7185' },
  { name:'Hemoglobin',        vals:[10.5,11,11.5,12,12.5,13.1], unit:'g/dL', normal:13.5, color:'#38bdf8' },
];
const tips = [
  { i:'ü•ó', c:'Diet',     t:'Increase leafy vegetables ‚Äî spinach, kale, and fenugreek help with low hemoglobin.', col:'#34d399' },
  { i:'üèÉ', c:'Exercise', t:'Walk 30 minutes daily ‚Äî improves blood sugar and cholesterol simultaneously.', col:'#38bdf8' },
  { i:'üíß', c:'Hydration',t:'Drink 8-10 glasses of water daily to support kidney function and circulation.', col:'#2dd4bf' },
  { i:'üò¥', c:'Sleep',    t:'Poor sleep raises blood sugar. Aim for 7-8 hours of quality sleep every night.', col:'#a78bfa' },
];
const rC = { HIGH:'#fb7185', MEDIUM:'#f59e0b', LOW:'#34d399' };
const rB = { HIGH:'rgba(251,113,133,0.12)', MEDIUM:'rgba(245,158,11,0.12)', LOW:'rgba(52,211,153,0.12)' };

export default function DashboardPage() {
  return (
    <div style={s.page}>
      <div style={s.hero} className="animate-up">
        <div className="section-label">Health Dashboard</div>
        <h1 style={s.h1}>Your health over time</h1>
        <p style={s.sub}>Track your progress and see how your values have improved</p>
      </div>

      {/* Stats */}
      <div style={s.statsRow} className="animate-up delay-1">
        {[
          { l:'Reports Analyzed', v:'6',   i:'üìÑ', c:'#38bdf8' },
          { l:'Current Risk',     v:'LOW', i:'üü¢', c:'#34d399' },
          { l:'Values Improved',  v:'4',   i:'üìà', c:'#2dd4bf' },
          { l:'Days Active',      v:'182', i:'üìÖ', c:'#a78bfa' },
        ].map((x,i)=>(
          <div key={i} className="glass-card" style={{padding:'24px 20px',textAlign:'center'}}>
            <div style={{fontSize:26,marginBottom:10}}>{x.i}</div>
            <div style={{fontFamily:'Fraunces,serif',fontSize:30,fontWeight:700,color:x.c,letterSpacing:'-0.5px',marginBottom:6}}>{x.v}</div>
            <div style={{fontSize:12,color:'#7a9cc4',fontWeight:500,textTransform:'uppercase',letterSpacing:'0.5px'}}>{x.l}</div>
          </div>
        ))}
      </div>

      {/* Timeline */}
      <div className="glass-card animate-up delay-2" style={{padding:28,marginBottom:20}}>
        <h3 style={s.sT}>üìã Report History</h3>
        <div style={{display:'flex',gap:0,alignItems:'flex-start',overflowX:'auto',paddingBottom:8}}>
          {history.map((r,i)=>(
            <div key={i} style={{display:'flex',flexDirection:'column',alignItems:'center',flex:1,minWidth:120,position:'relative'}}>
              <div style={{width:12,height:12,borderRadius:'50%',background:rC[r.risk],zIndex:1,marginBottom:10,flexShrink:0}}/>
              {i<history.length-1 && <div style={{position:'absolute',top:6,left:'50%',width:'100%',height:2,background:'rgba(56,189,248,0.1)',zIndex:0}}/>}
              <div style={{borderRadius:12,padding:'12px 14px',textAlign:'center',width:'90%',background:rB[r.risk],border:`1px solid ${rC[r.risk]}30`}}>
                <div style={{fontSize:11,color:'#7a9cc4',fontWeight:600,marginBottom:4,textTransform:'uppercase',letterSpacing:'0.5px'}}>{r.date}</div>
                <div style={{fontSize:14,fontWeight:800,letterSpacing:'0.5px',color:rC[r.risk],marginBottom:4}}>{r.risk}</div>
                <div style={{fontSize:11,color:'#7a9cc4'}}>{r.ab}/{r.tests} abnormal</div>
              </div>
            </div>
          ))}
        </div>
        <div style={{marginTop:16,padding:'12px 16px',background:'rgba(52,211,153,0.08)',border:'1px solid rgba(52,211,153,0.2)',borderRadius:10,fontSize:14,color:'#34d399'}}>
          ‚úÖ Great progress! You've gone from HIGH risk in August to LOW risk in January.
        </div>
      </div>

      {/* Charts */}
      <div className="glass-card animate-up delay-3" style={{padding:28,marginBottom:20}}>
        <h3 style={s.sT}>üìâ Value Trends (Last 6 Months)</h3>
        <div style={{display:'flex',flexDirection:'column',gap:32}}>
          {trends.map((t,ti)=>{
            const max = Math.max(...t.vals)*1.15;
            return (
              <div key={ti}>
                <div style={{display:'flex',alignItems:'center',gap:10,marginBottom:12}}>
                  <span style={{fontSize:14,fontWeight:700,color:t.color}}>{t.name}</span>
                  <span style={{fontSize:12,color:'#3d6090'}}>{t.unit}</span>
